import React from 'react'

const EmployeeList = () => {
  return (
    <div className='container max-auto my-8'>
     <div  className='h-12'>
      <button className='rouded bg-slate-600 text-white px-6 py-2 font-semibold '>
        Add Employee
      </button>
     </div>
    </div>
   
  )
}

export default EmployeeList;
